import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ScheduleAPIService {

  constructor() { }

  getSchedules() : Observable<any> {
    const schedules = {
      'name': 'Test',
      'dateFrom': '1/1/2023',
      'dateTo': '2/1/2023',

    };

    return of(schedules);
  }
}
